import React from 'react'
import Navbar from '../layouts/Navbar'
import { MDBContainer, MDBNavbar, MDBNavbarBrand } from 'mdb-react-ui-kit'

export function CheckoutNoAcc() {
    return (
        <div>
            <Navbar />

            <div>
            {stickyFooter()}
            </div>
        </div>
    )
}

export function CheckoutWithAcc() {
    return (
        <div>
            <Navbar></Navbar>
            <div>

            {stickyFooter()}
            </div>
        </div>
    )
}

function stickyFooter() {
    return (
        <MDBNavbar fixed='bottom' light bgColor='light' className='shadow-4-strong'>
            <MDBContainer fluid>
                <MDBNavbarBrand href='#'>Fixed bottom</MDBNavbarBrand>
            </MDBContainer>
        </MDBNavbar>
    )
}
